  "Gusto", "Zenefits", "Rippling", "Ease", "Namely", "Employee Navigator", "Paychex", 
  "ADP", "Benefitfocus", "Workday", "BambooHR", "TriNet", "Justworks", "Insperity", 
  "UKG", "Ceridian", "Paylocity", "Paycor", "Bswift", "Businessolver",

  // Industry descriptors
  "carrier", "insurance provider", "benefits platform", "HRIS", "HR platform", "payroll provider",

  // General categories
  "retired", "stay at home", "homemaker", "freelancer", "self-employed"
];

for (const item of items) {
  const title = (item.json.title || "").toLowerCase();
  const description = (item.json.description || "").toLowerCase();

  const matchedKeyword = keywords.find(keyword => {
    const lowerKeyword = keyword.toLowerCase();
    const pattern = new RegExp(`\\b${lowerKeyword.replace(/[.*+?^${}()|[\]\\]/g, '\\$&')}\\b`, 'i');
    return pattern.test(title) || pattern.test(description);
  });

  if (matchedKeyword) {
    throw new Error(`Disqualified due to keyword match: "${matchedKeyword}" in "${item.json.title}"`);
  }
}

return items;

const data = $json.data;

// Function to extract text from HTML while removing unnecessary spaces
function extractTextFromHTML(html) {
  if (typeof html !== 'string') {
    return '';
  }
  return html
    .replace(/<script[\s\S]*?>[\s\S]*?<\/script>/gi, '')
    .replace(/<style[\s\S]*?>[\s\S]*?<\/style>/gi, '')
    .replace(/<[^>]+>/g, '')
    .replace(/\s+/g, ' ')
    .trim();
}

let extractedText = extractTextFromHTML(data);

// Limit to 4000 words
const words = extractedText.split(' ');
if (words.length > 4000) {
  extractedText = words.slice(0, 4000).join(' ');
}

return { text: extractedText };

